// src/components/StateSelection.js
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/StateSelection.css';  // Add custom styles if needed

function StateSelection() {
  return (
    <div className="state-selection">
      <h1>Select a State for High Court Judgments</h1>
      <div className="states-grid">
        {/* Add links for different states */}
        <Link to="/high/delhi" className="state-item">Delhi</Link>
        <Link to="/high/mumbai" className="state-item">Mumbai</Link>
        <Link to="/high/kolkata" className="state-item">Kolkata</Link>
        {/* Add more states as needed */}
      </div>
    </div>
  );
}

export default StateSelection;
